//komi.dev/opengl-from-slime/":{"tf":1.0}},"df":1}}}}}}}}}}}},"p":{"docs":{},"df":0,"a":{"docs":{},"df":0,"c":{"docs":{},"df":0,"e":{"docs":{},"df":0,"m":{"docs":{},"df":0,"a":{"docs":{},"df":0,"c":{"docs":{},"df":0,"s":{"docs":{},"df":0,"で":{"docs":{},"df":0,"s":{"docs":{},"df":0,"l":{"docs":{},"df":0,"i":{"docs":{},"df":0,"m":{"docs":{},"df":0,"e":{"docs":{},"df":0,"を":{"docs":{},"df":0,"導":{"docs":{},"df":0,"入":{"docs":{},"df":0,"し":{"docs":{},"df":0,"て":{"docs":{},"df":0,"q":{"docs":{},"df":0,"u":{"docs":{},"df":0,"i":{"docs":{},"df":0,"c":{"docs":{},"df":0,"k":{"docs":{},"df":0,"l":{"docs":{},"df":0,"i":{"docs":{},"df":0,"s":{"docs":{},"df":0,"p":{"docs":{"https://komi.dev/slime-in-spacemacs/":{"tf":1.0}},"df":1}}}}}}}}}}}}}}}}}}}}}}}}}}}}},"w":{"docs":{},"df":0,"e":{"docs":{},"df":0,"b":{"docs":{},"df":0,"で":{"docs":{},"df":0,"a":{"docs":{},"df":0,"p":{"docs":{},"df":0,"i":{"docs":{"https://komi.dev/api-server-with-actix-web/":{"tf":1.0}},"df":1}}},"作":{"docs":{},"df":0,"っ":{"docs":{},"df":0,"た":{"docs":{},"df":0,"a":{"docs":{},"df":0,"p":{"docs":{},"df":0,"i":{"docs":{},"df":0,"サ":{"docs":{},"df":0,"ー":{"docs":{},"df":0,"バ":{"docs":{},"df":0,"ー":{"docs":{},"df":0,"に":{"docs":{},"df":0,"j":{"docs":{},"df":0,"s":{"docs":{},"df":0,"o":{"docs":{},"df":0,"n":{"docs":{},"df":0,"を":{"docs":{},"df":0,"p":{"docs":{},"df":0,"o":{"docs":{},"df":0,"s":{"docs":{},"df":0,"t":{"docs":{"https://komi.dev/json-post-to-actix-web/":{"tf":1.0}},"df":1}}}}}}}}}}}}}}}}}}}}}}},"o":{"docs":{},"df":0,"r":{"docs":{},"df":0,"l":{"docs":{},"df":0,"d":{"docs":{"https://komi.dev/hello-world/":{"tf":1.0}},"df":1}}}}},"z":{"docs":{},"df":0,"o":{"docs":{},"df":0,"l":{"docs":{},"df":0,"a":{"docs":{"https://komi.dev/hello-world/":{"tf":1.0}},"df":1}}},"s":{"docs":{},"df":0,"h":{"docs":{"https://komi.dev/zsh-subcommand-alias/":{"tf":1.0}},"df":1}}}}}},"documentStore":{"save":true,"docs":{"https://komi.dev/":{"body":"","id":"https://komi.dev/","title":""},"https://komi.dev/about/":{"body":"\nMy name is Yusuke Kominami.\nI'm 23 years old and living in Tokyo. And I work at SoftBank as a machine learning engineer and at Aiful as a technical adviser.\nI graduated from the faculty of Science in Kyoto University, majored Biology at Takada Lab.\nAbout software engineering, I love Rust. It is a perfect programming language, I think. My expertise ranges from HTML/CSS/JavaScript to Low-level programming. Furthermore, I have solid knowledge on machine learning and data science based on mathematics.\nOutside of computer, I love watching documentary movies and working out.\nYou can find me on Twitter.\n","id":"https://komi.dev/about/","title":"About"},"https://komi.dev/api-server-with-actix-web/":{"body":"現在ちょっとしたカレンダーアプリを作っており、バックエンドにはRustを採用している。\nリポジトリはここから。\nフレームワークにはActix-webを採用しており、今回バックエンドサイドはある程度書き上がったのでその所感をまとめてみようと思う。\nミニマム\nとにかく全体的に感じたのが、とにかくミニマムで取り回しやすいなという感じがした。\nマクロ等を利用したルーティングやURIディスパッチ、各種ミドルウェアの実装などをほんの数行で実現でき、簡易的なAPIサーバーを実装するにはかなり良いと思う。\n例えばマクロによるルーティングとURLディスパッチについて、自分も今作っているカレンダーアプリではこんなコードがある。\n#[get(\"/user/{username}\")]\npub async fn schedule_content(\n    info: web::Path&lt;UserData&gt;,\n    pool: web::Data&lt;DbPool&gt;,\n) -&gt; impl Responder {\n    let conn = pool.get().expect(\"couldn't get db connection from pool\");\n    let res = Schedule::get_schedule(info.username.clone(), &amp;conn);\n\n    match res {\n        Ok(contents) =&gt; web::Json(contents),\n        Err(_) =&gt; panic!(\"Not found schedule\"),\n    }\n}\n\n&nbsp;URLで/user/{username}として任意の文字列usernameに対して適当なコンテンツを打ち返すというのがこの関数の動作だけども、\n\n#[get(...)]という属性マクロを用いてルーティングを定義し、\ninfo: web::Path&lt;UserData&gt;として引数にURLのディスパッチを行う\n\nということができている。\n例えばこれをPythonのFlaskとかでやろうとするならもう少しコード量が必要になると思われる。\n別にPythonのFlaskでも良い感はあるが、やはりRustには型による安心感がある。\n実際、今回は{username}という任意の文字列をUserDataという型(構造体)に押し込めており、こちらとして事前に用意しておいたメソッドを適用させることなどができる。\nもちろん、場合によってはディスパッチされる型を整数型として受け取ることも可能である。\nこうした型の安全性とシンプルなコードを高いレベル両立できるのはやはりすごいと思う。\n拡張性\n今回のバックエンドとしてはそこまで複雑な動作をさせているわけではないが、地味にDBへの連携などの処理がある。\nその点、Actix-webはHTTPサーバーとしての処理とRust内部でのデータ処理のフェイズを綺麗に分けられているので、DieselなどのORMとの橋渡しが思ったよりスムーズにできた。\n正直なところDieselがORMとしてどうなのかという点については多少の文句はあるのだけど(やはりPythonのSQLAlchemyが最高な気がする)、Actix-webに関しては言えばそこらへんを非常に良く分業できているので、開発していてとてもユーザー体験が良かったと思う。\n実際、チュートリアルにもDieselとの接続について簡単なデザインパターンが載っており、これは初学者にとっては心強いと思う。\nこれ以外に、CSRF対策なども数行挟み込めばなんとかなる。\nuse actix_web::middleware::csrf;\n\nfn handle_post(_req: HttpRequest) -&gt; &amp;'static str {\n    \"This action should only be triggered with requests from the same site\"\n}\n\nfn main() {\n    let app = Application::new()\n        .middleware(\n            csrf::CsrfFilter::build()\n                .allowed_origin(\"https://www.example.com\")\n                .finish())\n        .resource(\"/\", |r| {\n            r.method(Method::GET).f(|_| httpcodes::HttpOk);\n            r.method(Method::POST).f(handle_post);\n        })\n        .finish();\n}\n\n他にもHTTP/2.0とかWebSocketあたりの先進的なWebの技術についてもしっかりカバーされており、やはり強い。\n非同期\nやはりActix-webについてはこれが嬉しい。\nasync/awaitを特に意識することなくサクッと実装でき、これは何よりも嬉しいポイントだと思う。\n開発者サイドからは非同期処理特有のめんどくさい部分がRustのasync構文によってtokioのランタイムをフル活用でき、ストレスなく非同期処理を実装できる。\n困ってないけど困りそうなポイント\n今回はActix-webでAPIサーバーを実装したわけで、割と開発がサクサク進んだので特に困ったポイントなどは無いのだけど、こういうケースだと少し困るかな、という点を上げておこうと思う。\n\n機能モリモリなMVCフレームワークではない\n\nDjangoやRailsの場合、データベースやフロントの方までフレームワークが管理しており、フレームワークが敷いたレールの上をしっかり歩めば良いというのが根幹の思想としてある。\n一方で、今回扱ったActix-webについてはそうした完全に全部をカバーするという思想ではなく必要な機能を必要な分だけ使うというイメージである。\nなので、例えばテンプレートエンジンなど込みで一つのフレームワークに乗っかって全て完結させたいんだーという場合において、Actix-webを含めて現存するRustのフレームワークでは実現が難しいポイントだと思う。\nただ、これについては個人的には問題ないと思っていて、というのもRustはとにかくシンプルにプロダクトを作成するという点においてかなり強みを発揮すると考えている。\n故にRustは疎結合な構成のWebアプリで使われると思っていて(そっちの方が型周りの良さが出てくると思う)、今のところそういう機能モリモリなMVCフレームワークはないし、これからもそういうのは登場する必要はないかなと思う。\n今後もWeb開発においてRustは局所的に高速に非同期処理したい場合で活躍していくと思う。\nまとめ\n今回はActix-webで実装をしてみた所感については簡単にまとめてみた。\n色々偉そうな感じのことを言ってしまっており、もしかしたら間違いがあるかもしれないので、その場合は後学やコミュニティのためにも指摘してもらえると嬉しい。\n今後もRustで開発していこうと思う。\n","id":"https://komi.dev/api-server-with-actix-web/","title":"\tActix-webでAPIサーバーを立てる"},"https://komi.dev/clojure-macro/":{"body":"引き続きClojureのお勉強。\n前回はClojureで簡単なメッセージを通信するHTTPサーバーを立てるところまでやった。\n今回はそこから発展してミドルウェアの作成などをやろう.....と思っていたのだけれど、色々なWebサイトを参考にしてちょこちょこコードを読んでいたところリーダマクロがわからずなんだこれ...?となることが多々あった。\nそこで今回はClojureでサーバーを構築する云々から一度離れてClojureのリーダマクロをささっとまとめておこうと思う。\nリーダマクロって？\nリーダマクロは接頭辞や接尾辞に何か文字を付け加えることで別の式に展開することを可能にするマクロ文字のこと。\n例えばラムダ式の定義においてClojureだと\nuser=&gt;  ((fn [x y] (+ x x)) 10 20)\n;; 30\n\nだったりするが、これはリーダマクロ#()を使うことで\nuser=&gt; (#(+ %1 %2) 10 20)\n;; 30\n\nという感じになる。\nちなみにこの例での%は引数の順番を表し、%1は第一引数のこと。第一引数は%としてもオッケー。\nこんな感じのマクロ文字がたくさんあるのだけれど、Clojure言語の実装を見てるとだいたいお気持ちが掴めてくるので以下ではそこらへんについてまとめていく。\nClojure言語のソースコードを見る\nClojureはJavaで実装されていて、リーダマクロあたりについては以下のあたりのコードに実装されている。\n[https://github.com/clojure/clojure/blob/master/src/jvm/clojure/lang/LispReader.java#L90-L120:embed:cite]\n中身はこうなっている。\n\t macros['\"'] = new StringReader();\n\tmacros[';'] = new CommentReader();\n\tmacros['\\''] = new WrappingReader(QUOTE);\n\tmacros['@'] = new WrappingReader(DEREF);//new DerefReader();\n\tmacros['^'] = new MetaReader();\n\tmacros['`'] = new SyntaxQuoteReader();\n\tmacros['~'] = new UnquoteReader();\n\tmacros['('] = new ListReader();\n\tmacros[')'] = new UnmatchedDelimiterReader();\n\tmacros['['] = new VectorReader();\n\tmacros[']'] = new UnmatchedDelimiterReader();\n\tmacros['{'] = new MapReader();\n\tmacros['}'] = new UnmatchedDelimiterReader();\n//\tmacros['|'] = new ArgVectorReader();\n\tmacros['\\\\'] = new CharacterReader();\n\tmacros['%'] = new ArgReader();\n\tmacros['#'] = new DispatchReader();\n\nこれを見てみると#にディスパッチマクロが割り当てられており、ディスパッチマクロについては以下の通りに定義されている。\n\t dispatchMacros['^'] = new MetaReader();\n\tdispatchMacros['#'] = new SymbolicValueReader();\n\tdispatchMacros['\\''] = new VarReader();\n\tdispatchMacros['\"'] = new RegexReader();\n\tdispatchMacros['('] = new FnReader();\n\tdispatchMacros['{'] = new SetReader();\n\tdispatchMacros['='] = new EvalReader();\n\tdispatchMacros['!'] = new CommentReader();\n\tdispatchMacros['&lt;'] = new UnreadableReader();\n\tdispatchMacros['_'] = new DiscardReader();\n\tdispatchMacros['?'] = new ConditionalReader();\n\tdispatchMacros[':'] = new NamespaceMapReader();\n\nディスパッチマクロとは、この場合マクロ文字#以降では別の式に変換するよーというような機能を持ったマクロで、リーダマクロの二段重ねくらいの認識で大丈夫なはず。\nさて、早速中身を見ていこうと思う。\nダブルクオーテーション\"とセミコロン;\n\t macros['\"'] = new StringReader();\n\tmacros[';'] = new CommentReader();\n\nこれについては変数名の通りで、\"は文字列を認識し;はコメントにするものである。\n実際にClojureのコードでは\n(println \"Hi Clojure !\")\n;; (println \"This is a just comment\")\n\nという感じになっている。\nシングルクオーテーション\\'\n次の\\'はシングルクオーテーションで、これはLisperにはお馴染みのシンボルを表す。\nClojureのシンボルはCommon Lispとは挙動が異なり、Common Lispではシンボルは値を内包していてシンボルと値が同一であるのに対し、Clojureはシンボルと値がそれぞれ独立で、それぞれを名前空間がマッピングしているという構造を持っているらしい。\n変数がunboundになることを想定したときシンボルと値は分けた方が都合がよいのでこのような構造をとっているらしく、ここらへんの挙動についてはRich HickeyのSimple made easyという哲学に基づいているもの、なんだとか。\n少し難しいが、ここらへんも勉強していかないとなぁという感じ。\nご指摘いただいた@lagenorhynqueさんありがとうございました！！！\n(def x 10)\n(println x) ; =&gt; 10\n(println 'x) ; =&gt; x\n(println (quote x)) ; =&gt; x\nアットマーク@\nさて、次の@はCommon Lispの畑からやってきた人間にとってはあまり見慣れないもの。\nClojureには並行処理をサポートしていて、その際に変数を参照して展開することをこの@は行ってくれる。\nrefが参照ならderefが参照はずし(展開するといった方が正確？)\n(def x (ref 10))\n(println x) ; =&gt; #object[clojure.lang.Ref 0x17aabeae {:status :ready, :val 10}]\n(println @x) ; =&gt; 10\n(println (deref x)) ; =&gt; 10\n\nちなみにこの@は遅延評価でも有効らしく、\n(def x (delay 10))\n(println x) ; =&gt; #object[clojure.lang.Ref 0x17aabeae {:status :pending, :val 10}]\n(println @x) ; =&gt; 10\n(println x) ; =&gt; #object[clojure.lang.Ref 0x17aabeae {:status :ready, :val 10}]\n\nこの場合、遅延評価によって実行の前後でステータスがpendingからreadyに変化しているに注意。\nキャレット^\nこれもまたCommon Lisperには見慣れないもので、Clojureでは実際の変数に対してコンパイル時の型の情報や名前空間などのメタ情報を付加することができる。\n実際、変数をprivateかpublicかのアクセス制限をかけるとき\n(def ^:private x 10)\n(def ^{:private true} x 10 ;; 上と同じ\n\nとしたり、もしくは型の情報(型ヒント)を明記するとき\n(defn- foo [^long i ^long j] (+ i j))\n\nとすればオッケー。\n実際にメタ情報を見ようとするなら\n(def ^:private x 10)\n(meta (var x)) \n;; {:private true, :line 1, :column 1, :file \"/private/var/...\"\n(meta #'x)\n\nとして見れる。\nここで変数xについて'xがただのシンボルだが#'xはまた特殊で、Clojure では変数や関数の実体への参照として var というものがある。\nよってREPLにて\n(def x 10)\n(println x)\n(println 'x)\n(println (var x))\n\nとして見てみると(var x)が名前空間から参照しているのがわかると思う。\nここらへんは解説するとクソ長くなるのと自分がまだ完全理解してないのでここらへんで切り上げることにする。\nバッククオーテーション`とチルダ~\nバッククオーテーションは式全体をシンボル化し、~はクオートを外す。\nCommon Lispだとアンクオートはカンマ,だったけどClojureではチルダ~になっているらしい。\nさて、ここらへんは難しくないのでささっと。\n(def x 10)\n(println `(1 x)) ; =&gt; (1 x)\n(println `(1 ~x)) ; =&gt; (1 10)\n\nちなみにここでクオートされたリストに対してアットマーク@を組み合わせると括弧を外すことができる。\n(def y '(2 3))\n(println `(1 ~@y) ; =&gt; (1 2 3)\n\nなんでこんなことができるのかというと、~@がUnquoted Splicingというリーダマクロだから。\nLispすごい。\n括弧とか( ) { } [ ]\nここらへんはリストとか集合とかベクトルとかのデータ型。\nめんどくさいので省略。\nシャープ+チルダ#^\nメタデータを付加することができるが、先述のキャレット^単体と何が違うとかというと、#^では独自のkey/valueをメタデータとして付与できる。\n...というのがClojure1.1とか1.2とかあたりの話らしい。\nなんでも、Clojure1.1ではキャレット^は非推奨で#^を推奨していたらしい。\nしかし手元で試してみたら普通にキャレット^単体でも独自のkey/valueがメタデータとして付与できて、なんだかよくわからない。\nどういう使い分けなんだろう？\n(def #^{:fuck-kyoto-univ 114514} x 10)\n(meta #'x)\n\nうーん、難しい。\n\n追記. Clojure1.10.1では#^はdeprecatedとなっているらしく、挙動自体は#^と^は変わらないらしい。\n\nシャープ+シャープ##\nこれはInfなどを表すものらしい。\n(/ 1.0 0.0) ; =&gt; ##Inf\nシャープ+シングルクオーテーション#'\nこれは(var x)と同じこと。\nさっきやった。\nシャープ+ダブルクオーテーション#\"...\"\nはい！出ました！みんな大好き正規表現！！！\nPythonだと最初にimport reとかやって正規表現ライブラリを引っ張ってきて...みたいな感じでやるけどClojureではデフォルトで正規表現を使えるのでなんと幸せなことだろうか....!!\n(re-find #\"\\d+\" \"abc12345def\") ; =&gt; \"12345\"\n(re-matches #\"hello, (.*)\" \"hello, world\") ; =&gt; [\"hello, world\" \"world\"]\n\n中の正規表現エンジンが先読みとか再帰とかのイケてるやつまでサポートしてるのかは知らないけど、Javaの正規表現のやつをラップしてる感じらしいので多分サポートしてるはず。\nシャープ+括弧#(...)\nこれはこのエントリーの最初の例にやったので省略。\nシャープ+波括弧#{...}\n集合ね。省略。\nシャープ+イコール#=\nこれは#=に続くフォームを評価するもので\n#=(+ 1 2 3) ; =&gt; 6\n(read-string \"#=(+ 1 2 3)\") ; =&gt; 6\n\nというような感じ。\n一つ注意点として*read-eval*がfalseになっている場合このリードマクロは機能しない。\n(binding [*read-eval* false] (read-string \"#=(+ 1 2 3)\")) \n; =&gt; 計算できませーん\nシャープ+エクスクラメーションマーク#!\nコメントになるらしい。\nシェバンとかで使えそう。\n#!(+ 1 2 3) ; =&gt; 反応なし\nシャープ+小なり大なり#&lt;...&gt;\nこれは以下のformを例外をThrowしてくれるらしい。\n例えば(atom 42)をREPLで評価すると#&lt;Atom: 42&gt;とprintされ、これはUnreadableで評価されないものなんだよー的なことが他のサイトに書いてあったけどなんだかよくわからない。\n参照 : CLJSのUnreadbleのページにて\nシャープ+アンダーバー#_\nこれはコメントの扱いになるらしい。\nつまり読まれず評価されない。\n#_(+ 1 2 3) ; =&gt; 反応なし\nシャープ+クエスチョンマーク#?\n環境非依存なコードを書くために、環境ごとに条件分岐をしてくれるものらしい。\nどういうことかというと、例えば以下のコードで\n#?(:clj \"Hi !\" :cljs \"Hello !\")\n\n実行がClojureならHi !とprintされ、ClojureScriptならHello !とprintされるらしい。\nそういえばClojureScriptなんてものあったな....(Clojureに入門してそこまで時間たってない顔)\nとりあえずこのディスパッチマクロはそういうものらしい。\nシャープ+コロン#:\nまず、コロン:はキーワード指定子であり、コロン+コロン::は現在の名前空間にキーワードを紐付けるものである。\nその前提で、シャープ+コロン#:は名前空間にキーワードをまとめて紐づけることができる。\n具体的に、\n#:person{:first \"Han\"\n         :last \"Solo\"\n         :ship #:ship{:name \"Millennium Falcon\"\n                      :model \"YT-1300f light freighter\"}}\n\nは以下のように読み替えられる。\n{:person/first \"Han\"\n :person/last \"Solo\"\n :person/ship {:ship/name \"Millennium Falcon\"\n               :ship/model \"YT-1300f light freighter\"}}\n\nさて、コロン+コロン::は現在の名前空間にキーワードを紐付けるので#::も同様に\n(ns rebel.core\n  (:require\n    [rebel.person :as p]\n    [rebel.ship   :as s] ))\n\n#::p{:first \"Han\"\n     :last \"Solo\"\n     :ship #::s{:name \"Millennium Falcon\"\n                :model \"YT-1300f light freighter\"}}\n\nは以下の通りとなる。\n{:rebel.person/first \"Han\"\n :rebel.person/last \"Solo\"\n :rebel.person/ship {:rebel.ship/name \"Millennium Falcon\"\n                     :rebel.ship/model \"YT-1300f light freighter\"}}\nまとめ\n意外とリーダマクロはそこまで多くないらしい。\nただ、いくつか挙動が謎なものもあって、自分でコードを書くときは不安だけどコードを読む分には最低限は大丈夫そう。\nところでメタデータで型情報を渡したらコンパイルとか速くなるものなんだろうか？\nあくまで型ヒントみたいな感じでPythonのType Hintingみたいにコードに虚無を植え付けるだけとかだと感情も虚無になってしまうので....\nとりあえずだんだんとClojureが楽しくなってきた。\nさあこれからもがんばるぞい！\n","id":"https://komi.dev/clojure-macro/","title":"Clojureのリーダマクロをざざっと理解する"},"https://komi.dev/clojure-mini-server/":{"body":"先日の奨学金返金エントリーに対して辛辣なコメントが飛び交っており心を痛めている今日この頃。\nこのエントリーは返納までの期日が超絶短期間に設定されたことを問題視したものだったのだけれど、返金することになったことへの批判と擁護が予想以上に飛んできて色々想定外でいやそうじゃないんだよなぁという感情しかなかったのでいくつか追記しておいた。\n多分もう大丈夫だと思われる。\nさて、前置きという名のボヤキはここらへんにしておいて、最近もちまちまとClojureの勉強を進めている。\n今日はClojureのサーバーの立て方とその周りの云々やっていて、その際に色々つまづいたものをここでテキトーにまとめておこうと思う。\n概要\nPythonでサーバーを立てる場合、ターミナル上で\n$ python -m http.server 8080\n\nとしたり、もしくはソースコードとして\nimport http.server\nimport socketserver\n\nPORT = 8000\nHandler = http.server.SimpleHTTPRequestHandler\n\nwith socketserver.TCPServer((\"\", PORT), Handler) as httpd:\n    print(\"serving at port\", PORT)\n    httpd.serve_forever()\n\nと書いてこれを実行することでサーバーを立てることができる。\nPythonにはWSGI(Web Server Gateway Interface, ウィズギーと呼ぶらしい)というWebアプリケーションとWebサーバーの間をなすインターフェースがあり、WebアプリケーションとWebサーバーの実装を切り離すことで柔軟なアーキテクチャ設計ができるようになっている。\nそんなアプリケーションとサーバーの間のクッションだが、JavaではそのインターフェースとしてJava Servlet APIがあり、そしてClojureの場合はRingというものがその役割を果たしている。\nプロジェクトを立ち上げる\nさて、概要はなんとなく掴んだのでいざ実装。\nClojureのプロジェクトはLeiningenを使ってビルドしていくので、まずプロジェクトを立ち上げる。\n$ lein new app mini-server\n$ cd mini-server\n\nこれでappをベースとしたプロジェクトディレクトリができる(デフォルトではlibraryをベースとしている)\nClojureはPythonと違ってREPLに入ったあとに自由にモジュールをimportできるわけではなく、最初にプロジェクトファイルに何のモジュールを使うか書いておく必要があるのでこれを記述する(別にプロジェクトファイルに書かずとも何とかなる方法はあるが割愛)\nproject.cljにてdependenciesにRingを追記する。\n(defproject mini-server \"0.1.0-SNAPSHOT\"\n  :description \"FIXME: write description\"\n  :url \"http://example.com/FIXME\"\n  :license {:name \"EPL-2.0 OR GPL-2.0-or-later WITH Classpath-exception-2.0\"\n            :url \"https://www.eclipse.org/legal/epl-2.0/\"}\n  :dependencies [[org.clojure/clojure \"1.10.0\"]\n                 [ring \"1.7.1\"]]\n  :main ^:skip-aot mini-server.core\n  :target-path \"target/%s\"\n  :profiles {:uberjar {:aot :all}})\n\nちゃんとバージョンを書いておく必要あり。\nこれでターミナルにてLeiningenのREPLを起動すると必要なモジュールを用意してくれるのでターミナルにて早速使ってみる。\nまずREPLを起動。\n$ lein repl\n\nそして動かしてみる。\nmini-server.core=&gt; (require '[ring.adapter.jetty :as s])\n;; =&gt; nil\nmini-server.core=&gt; (def server (atom nil))\n;; =&gt; #'mini-server.core/server\nmini-server.core=&gt; (reset! server \n              #_=&gt;         (s/run-jetty (fn [req] \n              #_=&gt;                        {:body \"Hi ! This is test server !\"}) \n              #_=&gt;                      {:port 3000 :join? false}))\n\n途中の引数にて:join?はtrueの場合スレッドをサーバーが止まるまでブロックするのでREPLに帰ってこれなくなるためfalseにしておいた。\nこれを実行してブラウザにてlocalhost:3000を見てみると\nHi ! This is test server !\n\nと表示されていると思う。\nさて、動いていることが確認できたので今度はサーバーを止める。\nmini-server.core=&gt; (.stop @server)\n;; =&gt; nil\nmini-server.core=&gt; (reset! server nil)\n;; =&gt; nil\nまとめ\n今回はClojureでRingを使って簡単なHTTPリクエストを送るサーバーを実装した。\nこれからはもっとサーバーのライフサイクルをもっと簡潔に扱えるようなものを作り、ミドルウェアなども作っていこうと思う。\nとりあえず今日はここまで。\n余談\nエントリーを書いてるときブラウザでのフォントが等幅フォントではないのでコードの部分のインデントを合わせるのが若干めんどくさい。\nかといって今のフォントは読みやすいので記事を書いているときだけ別のフォントに切り替えることができたら色々捗りそう。\nここらへんもそのうち模索してみる予定。\n出典\n\nClojureでWeb開発をはじめてみよう\nミニマリストのためのClojure REST API開発入門\n\n","id":"https://komi.dev/clojure-mini-server/","title":"Clojureで超絶極小サーバーを立てる"},"https://komi.dev/diesel-postgres/":{"body":"最近はずっとRustで簡単なWebアプリを作っているのだけど、PostgreSQLへの接続にちょっと困ったのでメモ。\n環境\n\nRust: 1.45.0\n\n[dependencies]\nactix-web = \"2.0.0\"\nactix-rt = \"1.1.1\"\ndiesel = { version = \"1.4.5\", features = [\"postgres\", \"chrono\", \"r2d2\"] }\ndotenv = \"0.15.0\"\nserde = \"1.0.114\"\nchrono = { version = \"0.4.13\", features = [\"serde\"] }\nr2d2 = \"0.8.9\"\nやったこと\nまず最初にDiesel CLIを入れる。\ncargo install diesel_cli\n\nその後、作業ディレクトリの中で.envというファイルを作り、その中に\nDATABASE_URL=postgres://[username]:[password]@localhost/[some_name]\n\nと書き込む。\nこのときusernameとpasswordはローカル環境なら端末のユーザー名とパスワード。\n次にPostgreSQLサーバーを立てる。\nPostgreSQLのインストールで、Macの場合は\nbrew install postgresql\n\nとする。\nこれを入れることで\n# PostgreSQLサーバー起動\npostgres -D /usr/local/var/postgres\n\n# PostgreSQLサーバーへ接続するためのクライアント\npsql -h [ホスト名] -U [ユーザー名] -p [パスワード] [テーブル名]\n\n# テーブル作成\ncreatedb -h [ホスト名] -U [ユーザー名] -p [パスワード] [テーブル名]\n\nなどのコマンドが打てる。\nローカル環境の場合はpsqlコマンドの-hや-Uなどのオプションはデフォルトでlocalhostに繋がるようになっており、手元で簡単に試すのであればpsql [テーブル名]などすれば良い。\nさて、今回はDieselでPostgreSQLにつなぐことが目的なので、サーバーを立てる。\npostgres -D /usr/local/var/postgres\n\nこれを裏でやっておいて、作業ディレクトリでDieselのセットアップをする。\ndiesel setup\n\nこうすると先ほど後ろで走らせておいたPostgreSQLサーバーに通信が飛んだのがわかると思う。\nあとはDieselのチュートリアルの通りにやればよく、まずSQLのコマンドを生成する。\ndiesel migration generate create_posts\n\nこれをやると作業ディレクトリにmigrationというディレクトリが作られ、中にup.sqlとdown.sqlというファイルが作られる。\nそれぞれ\nCREATE TABLE posts (\n  id SERIAL PRIMARY KEY,\n  title VARCHAR NOT NULL,\n  body TEXT NOT NULL,\n  published BOOLEAN NOT NULL DEFAULT 'f'\n)\nDROP TABLE posts\n\nと書き込む。\nあとは\ndiesel migration run\n\nとコマンドを打てば、裏側で走らせてるPostgreSQLサーバーが走ってCREATE TABLEしてくれる。\n反省\n最初に作業をしていたとき、ローカルでPostgreSQLサーバーを立てるのがめんどくさくて、.envの中を\nDATABASE_URL=\"test.db\"\n\nとしており、実際にdiesel setupなどをすると若干怪しい動きをしつつも作業ディレクトリにtest.dbというファイルが生成されていたのでイケると勝手に勘違いしていた。\nその後、作業を続けてActix-webでHTTPサーバー立てようとしたときデータベースへの繋ぎ込みがうまくいかないことが原因となってHTTPサーバー自体も立ち上がらず...\nそんなこんなでかなり時間を食ってしまった(CircleCIもめちゃくちゃコケた)ので、これからはローカル開発でもサボらずにサーバーを立てようと思う。\n","id":"https://komi.dev/diesel-postgres/","title":"DieselでPostgreSQLに接続"},"https://komi.dev/hello-world/":{"body":"個人サイトを作り直してみた\n今までは自分でReactを使ってサイトを構築していたが、ブログ機能が欲しいと思い始めた。\nというのも、エンジニアたるもの、はてなブログ等に完全に依存するよりも自分で作ってしまった方が技術力とかのアピールになるような気がした。\nまた、はてなブログ等の場合は広告などがめちゃくちゃ走るため、サイトのレンダリングがやや遅いような気がしていた。\nということで今回はZolaとGitHub Pagesを作り直してみたので、そこらへんについて紹介したい。\n","id":"https://komi.dev/hello-world/","title":"Hello World with Zola"},"https://komi.dev/json-post-to-actix-web/":{"body":"TL; DR\nserde_jsonは、curlコマンドでシングルクオーテーションとダブルクオーテーションの順序を気にするらしく\ncurl -X POST -H \"Content-Type:application/json\" \\                                                           master\n-d \"{'username': 'komi'}\" \\\nhttp://localhost:8000/search\n\nはダメで\ncurl -X POST -H \"Content-Type:application/json\" \\                                                           master\n-d '{\"username\": \"komi\"}' \\\nhttp://localhost:8000/search\n\nはオッケーらしい。\n状況\nActix-webでAPIサーバーを開発していて、POSTするAPIを書いてみたのだが、テストコードは動いてるのに手元でcurlで叩いてみるとなぜか動かない現象に遭遇した。\nコードは以下の通り。\nuse diesel::prelude::*;\nuse diesel::r2d2::{self, ConnectionManager};\nuse dotenv::dotenv;\nuse std::env;\n\npub type DbPool = r2d2::Pool&lt;ConnectionManager&lt;PgConnection&gt;&gt;;\n\npub fn make_pool() -&gt; DbPool {\n    dotenv().ok();\n    let database_url = env::var(\"DATABASE_URL\").expect(\"DATABASE_URL must be set\");\n\n    let manager = ConnectionManager::&lt;PgConnection&gt;::new(database_url);\n    r2d2::Pool::builder()\n        .build(manager)\n        .expect(\"Failed to create pool.\")\n}\n\n#[post(\"/search\")]\npub async fn search_user(info: web::Json&lt;UserData&gt;, pool: web::Data&lt;DbPool&gt;) -&gt; impl Responder {\n    let conn = pool.get().expect(\"couldn't get db connection from pool\");\n    let res = Schedule::get_schedule(info.username.clone(), &amp;conn);\n\n    match res {\n        Ok(content) if content.len() &gt; 0 =&gt; web::Json(Info { result: true }),\n        _ =&gt; web::Json(Info { result: false }),\n    }\n}\n\nターミナルで叩いたコマンドは\ncurl -X POST -H \"Content-Type:application/json\" \\                                                           master\n-d \"{'username': 'komi'}\" \\\nhttp://localhost:8000/search\n\nエラーメッセージは以下の通り。\n[2020-08-24T12:20:50Z DEBUG actix_web::types::json] Failed to deserialize Json from payload. Request path: /search\n[2020-08-24T12:20:50Z DEBUG actix_web::middleware::logger] Error in response: Deserialize(Error(\"key must be a string\", line: 1, column: 2))\n[2020-08-24T12:20:50Z INFO  actix_web::middleware::logger] 127.0.0.1:53552 \"POST /search HTTP/1.1\" 400 0 \"-\" \"curl/7.64.1\" 0.000690\n\nどうやらJSONのロードに失敗しているらしい。\nしかしテストコードは動いている。\nなぜだろうかと考えて、Actix-webのサンプルなどを叩いてみたところ、そちらは動く。\nひょっとしたらr2d2が何か悪さをしているのかと調べてみるが、これは問題ないらしい。\nそうこうして調べてるうちに、テキトーにコピペしてみたコマンドが動いたり動かなかったりするのを発見。\n結局のところ原因は何だったかというと、シングルクオーテーションとダブルクオーテーションの順序だった。\nつまり\n\"{'username': 'komi'}\"\n\nはダメで、\n'{\"username\": \"komi\"}'\n\nはオッケーらしい。\n自分は今までシングルクオーテーションとダブルクオーテーションの順序などあまり気にしたことがなかったので、今回このようなケースにハマって微妙な時間を溶かした。\nそりゃ確かにテストコードは通ってもコマンドは動かない。\nということで原因は見つかって、自分もちょっと学びになった。\n","id":"https://komi.dev/json-post-to-actix-web/","title":"\tActix-webで作ったAPIサーバーにJSONをPOSTする"},"https://komi.dev/opengl-from-slime/":{"body":"Lispの開発においてSLIMEは必須のものであり生命線。\nこれがあるとないとでは開発効率は10倍以上は変わるだろうし、LispをLispたらしめている要因の一つであるのがSLIMEなんだと思う。\nそんなSLIMEを使って現在は開発を進めているのだけれど、実は一つ問題が発生していた。\n現在趣味でCommon Lispでグラフィック系のものを作っているのだけれど、SLIMEからだとウィンドウが立ち上がらないのである。\nこれがSLIMEで長いこと目の上のタンコブであったわけだけど、今回なんとか解決したのでメモ書き。\n概要\n環境はmacOS CatalinaでSBCLのバージョンは1.5.7.55、Emacsは26.3。\nそもそもSLIMEとはEmacs起動中に裏側でLispのREPLを起動したサーバーを立てておいて、それをエディタからそのREPLに通信するという方式をとっている。\n今回問題が起きていたのは、SLIMEのREPLサーバーに対しての通信方式で、デフォルトだと通信に個別のスレッドを使用する方法を採用している。\nこれだとREPL上の白黒のデータを動かすようなスレッドはちゃんと動いてもグラフィック系のような別ウィンドウを立ち上げるものはうまくいかない(個別のスレッドなのでデータのやり取りが途切れてしまう)。\nなので、SLIMEの通信方式をデフォルトの個別のスレッドを使用する方式からループアプローチに変更する必要がある。\nコード\n自分の環境では、Emacsの設定ファイルはホームディレクトリに設定ファイルを格納したファイルを入れており、SLIMEはそのディレクトリ内に格納している。\n実際、\n~/.emacs.d\n├── init.el\n├── slime/\n│&nbsp;&nbsp; ├── swank.lisp\n│&nbsp;&nbsp; ├── README.md\n...\n\nというような構造をとっている。\nSLIMEの利用に関してはinit.elの中にて(add-to-list 'load-path (expand-file-name \"~/.emacs.d/slime\"))としてSLIMEのファイルをロードしている。\nさて、今回変更を書き加えるのはこの~/.emacs.d/slime/内のswank.lisp。\nまず、先ほど述べた通り、SLIMEの通信方式を変える。\nこのswank.lispの130行目あたりから始まるConnectionのところにて、*communication-style*をnilから:fd-handlerにする。\n(defstruct (connection\n             (:constructor %make-connection)\n             (:conc-name connection.)\n             (:print-function print-connection))\n  ;; The listening socket. (usually closed)\n  (socket           (missing-arg) :type t :read-only t)\n  ;; Character I/O stream of socket connection.  Read-only to avoid\n  ;; race conditions during initialization.\n  (socket-io        (missing-arg) :type stream :read-only t)\n  ;; Optional dedicated output socket (backending `user-output' slot).\n  ;; Has a slot so that it can be closed with the connection.\n  (dedicated-output nil :type (or stream null))\n  ;; Streams that can be used for user interaction, with requests\n  ;; redirected to Emacs.\n  (user-input       nil :type (or stream null))\n  (user-output      nil :type (or stream null))\n  (user-io          nil :type (or stream null))\n  ;; Bindings used for this connection (usually streams)\n  (env '() :type list)\n  ;; A stream that we use for *trace-output*; if nil, we user user-output.\n  (trace-output     nil :type (or stream null))\n  ;; A stream where we send REPL results.\n  (repl-results     nil :type (or stream null))\n  ;; Cache of macro-indentation information that has been sent to Emacs.\n  ;; This is used for preparing deltas to update Emacs's knowledge.\n  ;; Maps: symbol -&gt; indentation-specification\n  (indentation-cache (make-hash-table :test 'eq) :type hash-table)\n  ;; The list of packages represented in the cache:\n  (indentation-cache-packages '())\n  ;; The communication style used.\n  (communication-style :fd-handler :type (member nil :spawn :sigio :fd-handler))  ;; この部分！\n  )\n\n次に、swank.lispの最後の方にて、(defun before-init ...に(setq *communication-style* nil)と書き加える。\n(defun before-init (version load-path)\n  (pushnew :swank *features*)\n  (setq *swank-wire-protocol-version* version)\n  (setq *load-path* load-path)\n  (setq *communication-style* nil))  ;; この部分！\n\nこの2つをやれば動くようになった。\n果たしてこれが正しいのかはわからないけど、とにかく動くようになって作業が捗るようになったので良いと思う。\nまとめ\n今回はSLIMEの設定ファイルを直接いじることによってSLIMEからCL-OpenGLを叩けるようにした。\nなんとか解決したので、ようやく開発にスピード感が出てくると思われる。\nがんばっていきたい。\n","id":"https://komi.dev/opengl-from-slime/","title":"SLIMEからOpenGLを触る"},"https://komi.dev/pages/":{"body":"","id":"https://komi.dev/pages/","title":""},"https://komi.dev/return-scholarship/":{"body":"つい先日ツイートした通り、奨学金71万円を返納した。\n正直なところもう今回の奨学金返納騒動の件については忌々しい感情しかないので文に起こすのも憚られるのだけど、なんとか収束して落ち着いたので便所の落書き程度の気持ちでブログに残しておこうと思う。\n発端\nそもそも今回の騒動は去年自分がスイスに留学したことから始まる。\n去年の8月からスイスに留学することが決まっており、そのための留学資金を調達することが必要で、その際に資金調達先として選んだのが文科省が主宰するトビタテ留学Japan (以下、「トビタテ」と略す) という給付型留学奨学金プロジェクトだった。\nこのトビタテの奨学金の受給条件としていくつかあり、\n\n交換留学や研究留学など、正規留学ではなく日本の大学に在籍していること\n留学期間は2年以内\nインターンやボランティアなどの授業以外の活動を行うこと\n\nなどがある。\n今回自分は留学先でインターンをしてくるとして奨学金を受給することが決まっていた。\n留学前のトラブル\n留学開始にあたって一つトラブルがあり、奨学金の給付開始が9月からで、自分が渡航するのが8月からで1ヶ月分の生活費や保険代などが必要で、しかし手元の口座はすっからかんだった。\n20万円程度が必要だったのだがクラウドファンディングのおかげで1週間で30万円以上集まり、無事に留学できることになった。\n当時の支援していただいた各位には今でも感謝している。\n留学から帰国\nそんなこんなでスイスに留学していたのだけれど、数ヶ月経った頃に家庭の事情や進路の問題から帰国することになった。\n具体的に、研究室配属や大学院入試の時期の問題と実家の教育ローンが膨らみすぎていることが発覚したことなどがある。\nそんな背景で帰国してきたわけだけれど、トビタテ側からすれば勝手に帰国してきたという風に映るわけで、帰国したところ契約違反ということで奨学金全額返金しろという旨の連絡がきた。\nトビタテのシステムとして、学生が自由に留学計画をデザインしてそれをトビタテ側にプレゼンしてそれで受給者を選ぶという形になっている。\nそういうことで自分は今回の家庭の事情や進路の関係で帰国してきたので、留学計画を当初のものから今回帰国するまでのものに変更するという留学計画の変更を願い出ることにした。\nここで厄介なのがこの留学計画の変更で、変更が認められるまでかなりハードルが高く、同時に変更が受理されるまでかなり時間がかかる(数ヶ月から約半年)\nさて、結果として自分の留学計画の変更はどうだったかというと、変更は認められなかった。\nそんなこんなでトビタテ生を辞退させられることになり、そうして留学中に支給した奨学金は返金することになった。\n給付型奨学金が借金に化けた。しかも相手は文科省。\n\n追記1. 後述にて「今回奨学金を返納することになったのも原因は自分の計画性の無さなどにあるので、個人的には奨学金の返納は自業自得だし仕方ないかなみたいに考えてい」るとあり、返金すること自体については特に被害者意識を持っていないことに注意されたい\n\n\n借金を背負って\n留学から帰ってきて進路について考えている中で、大学院進学はすることなく就職することにした。\n今回奨学金を返納することになったのも原因は自分の計画性の無さなどにあるので、個人的には奨学金の返納は自業自得だし仕方ないかなみたいに考えていた。\n奨学金の返納が決まったのでこれから来年からコツコツ返していかなきゃな〜俺も奨学金返済組になって毎月数万円給料から数万円引っこ抜かれるんか〜めんどいな〜なんてことも考えていた。\nしかし事実は小説よりも奇なり、文科省との約束を守らなかった罪は想像以上に重かった。\n今年の4月上旬に大学の窓口に呼び出され、そのときのやり取りが以下。\n窓口の人「奨学金の件なんやけど、5月末に返せる？」\n\nぼく「...？ 来年ですか？」\n\n窓口の人「いや、今年。来月。一括で」\n\nぼく「留学準備金25万円と毎月16万円が3ヶ月でトータル73万円を？」\n\n窓口の人「うん、そやね」\n\n流石に唖然。\n金がないから奨学金をもらったというのに、ほんの1ヶ月で70万もの大金出せるわけが無い。\n最近話題のAI人材ということで普段からそれなりの時給でバイトをしていたが、流石に1ヶ月では腎臓でも売らない限り無理。\n流石にこれは無理だと文句を言い、そっちは金欠でもないんだしなぜそこまで性急な返金を要求するのか、時期をもう少しズラしてくれと頼んだところ10月末までに返せということに。\n渋々承諾し、数ヶ月で70万以上稼がなければならないことになった。\n\n追記2. 奨学金の誓約書には「違約の場合は奨学金を返納すること」とあったが返納の期日について明記されていなかった。\n\nお金を用意するために\n70万以上もの大金を用意するためにバイトをガチることになった。\nしかし時期が悪く、4月5月は就活でいろんな会社を訪問したりで落ち着いてバイトすることはできていなかった。\n気がつけば6月にもなり、そろそろタイムリミット的にもキツい感じになった。\n生活費や交際費、通信費などを稼ぎつつ70万以上もの大金を用意することはかなり厳しく、そこでバイトだけでは追いつかないということで、バイト2本に加えて業務委託を受けることにした。\nまた、これ以外にも夏には給料が出るインターンにも行くことにした。\n幸いなことにインターンの選考は2社通り、LINE Kyotoとフライウィールの2社に行かせてもらった。\nここらへんについては以下のエントリーを参照。\n[https://komi.hatenadiary.com/entry/2019/07/10/000732:embed:cite]\nこのエントリー内ではスキルアップのためとか社会勉強のためとか書いてあるが、実は今回のインターンで自分の中での裏テーマが奨学金返済だった。\n受け入れ先の企業には少し申し訳ない気持ちもあったが、インターン自体はかなり楽しませてもらった。\n給料について、LINE Kyotoは1週間で8万円、フライウィールは1ヶ月40万円だった(各社は本当にありがとうございました)\nということで8,９月はLINE Kyotoに1週間とフライウィールに1ヶ月半、それと現在はアイフルでバイトしているのでアイフルを1週間ちょっと、という感じでこの8, 9月でだいたい80万くらい稼ぐことができた。\nちなみに7月はバイトと先述の業務委託で25万程度稼ぐことができた。\nということで生活費や交際費、家賃などを差し引いても奨学金の返済に問題ない感じになったので気は熟したというわけである。\nちなみにお察しの通り、扶養控除枠の108万円までの枠については7, 8, 9月の3ヶ月で吹き飛ばした。\n年末は確定申告がんばります。\n返済準備ができた\n9月分の給料が10月25日に入ってきて、準備は整った。\nさあ振り込むぞというところで窓口の人から電話。\n窓口「早く返金してください」\n\nここへ来て圧力かけてくるのか。相手が学生だということを認知しているんだろうか。\n向こうもうるさいのでさっさと返金することに。\n[f:id:komi1230:20191026220803j:plain]返金請求の手紙\nさて、窓口からの返金請求の紙には給付した奨学金の一部の71万円振り込めと書いてある。\n留学の際に受け取った留学準備金25万円と毎月の給付で16万円が3ヶ月分のトータル73万円。\nつまり謎の2万円の減額があり、それで73万円のうち71万円を返せというわけである。\n奨学金及び留学準備金の一部請求と書いてあってかなりムカつくがここはスルー。(ほぼ全額でどこが一部なんだろうか)\nそんなこんなでついに銀行で所定の口座に71万円を振り込んだ。\nこれにて完全勝利。ようやく長い戦いが終わった。\nしかし流石は文科省、ただでは終わらない。\n返金が完了した胸を窓口に報告しに行ったところ\n窓口の人「2万円もらえて良かったですね^^」\n\nぼく「！？」\n\n窓口の人「それでは2万円の受領書にサインしてください^^」\n\nなんてこった。向こうは善意で学生に2万円プレゼントしたという姿勢をとってきたのである。\nもうこの世界はカオスなのだと窓口を去りながら強く思った。\n何はともあれ、これにて奨学金返済騒動は完全に終結した。\n終わりに\nこのエントリーの冒頭でこの奨学金騒動について忌々しい感情しかないと書いたのはこうした背景にある。\n何度も言うが、奨学金を返済すること自体には何も文句はない。全ては自分に原因があるので。\nしかし71万という大金を数ヶ月で用意して一括で振り込めなんて完全にヤクザの所業だと思う。\n文科省側には見捨てられ続けた。\n色々家庭の事情などを訴えたものの全て無視された。\nトビタテ本部の人にFacebookのMessangerで訴えてみたもののこれから会議始まるから後で返事するねと言われて3ヶ月以上経った。いつまで会議しているんだろう。\nだが困ったときはたくさんいろんな人が助けてくれる。\n業務委託を紹介してくれたエンジニアの方や返済で相談に乗ってくれた弁護士の方や話を聞いてくれた教授などなど。\nまさに捨てる神あれば拾う神ありである。\n色々学びがあった。たくさん学んだ。\n自分に将来子どもができたとき奨学金に頼らずにやっていけるように高給取りになれるようになろうと強く思った。\nこの国で奨学金に関わったら最終的に憂き目に合う気がしてならない。\nところで自分はいわゆるAI人材というやつで学生ソフトウェアエンジニア業界は高給インターンだったり高給なバイト、業務委託などがあるので稼ぎ口は色々あるのだけれど、自分のように留学計画の変更を認められずトビタテ生の辞退を余儀なくされて奨学金の返納を迫られている人はどうなるんだろう。\n大学生にして自分で借金を抱え込むんだろうか。\nもう自分は済んだので良いのだけれど、他の人はどうなっているのかが気になる。\nもうわからない。やはりこの世界はカオスである。\n\n追記3. 当記事は返金することになったことではなく「返金の期日が異常なほどに短気に設定された」ことについて問題視して書いたつもりである。当記事について返金することになったことに多数の反応があるが、記事中に「何度も言うが、奨学金を返済すること自体には何も文句はない。全ては自分に原因がある」としていて、返金することになったこと自体については大した問題ではないと認識いただけると幸いである。\n\n","id":"https://komi.dev/return-scholarship/","title":"給付型留学奨学金の71万円を返納した"},"https://komi.dev/rust-in-emacs/":{"body":"今までRustの開発はrust-modeに委ねていたのだけど、ふとツイッターでrusticなるものを知った。\n試しに入れてみたら開発環境の構築がかなり簡単に片付いて色々リッチになったのでメモ。\n設定は以下の通り。\n;; Rust\n(require 'rustic)\n(setq-default rustic-format-trigger 'on-save)\n(setq rustic-rustfmt-bin \"~/.cargo/bin/rustfmt\")\n(add-to-list 'rustic-rustfmt-config-alist '(\"edition\" . \"2018\"))\n(setq lsp-rust-analyzer-server-command '(\"~/usr/local/bin/rust-analyzer\"))\n\n実を言うとそこまでリッチにしなくても良い感はあって、ある程度補完が効いて型情報などが取れればいい感があるのだけど、今回環境構築をするついでにformatterが自動で効くようにした。\nこれは2, 3行目のところで、ファイルを保存した際にCargoでインストールしたrustfmtが走るようになっている。\n4行目のadd-to-listのところについて、rusticのformatterはなぜかデフォルトでeditionが2015となっていて、async構文を見るとformatterがエラーを吐いてしまう。\nなのでconfigにeditionが2018であることを明記する必要があった。\nLSPのサーバーにはrust-analyzerを使っていて、自分はHomebrew経由でインストールしているのでパスをこのように記述した。\nrust-analyzerのインストールは以下の通り。\nbrew install rust-analyzer\n\n自分の今のところのRustの開発環境はこんな具合。\nRust楽しんでいくぞ〜〜〜\n","id":"https://komi.dev/rust-in-emacs/","title":"EmacsでRustの開発環境を整える"},"https://komi.dev/slime-in-spacemacs/":{"body":"Lispを書くときに必要不可欠とも言えるのがSLIMEですよね。\nSLIMEとはLispをIDEっぽくするやつで、Lisperにとっては無くてはならないものです。\nさて、今回はそんなSLIMEを今回Spacemacsで叩けるようにして最終的にQuicklispも使えるようにするのが目標です。\n環境\nぼくの環境はmacOS Mojaveです。\nあと、ぼくはシェルにXonshというやつを使っています。\nもしかしたらこのXonshが微妙な悪さをしていて設定に悪影響を及ぼしている可能性があるのですが、とりあえず今回自分はこうしてうまくいったという1つの事例として留めておきます。\n多分Linuxの人もそこまで導入に関しては大きく変わらないはず。\nSpacemacsが見ている設定ファイル\nEmacsの場合、設定ファイルは\n\n~/.emacs.el\n~/.emacs\n~/.emacs.d/init.el\n~/.emacs.d/init\n\nの順番に見ていって、最初に見つけたやつだけを設定ファイルとして読み込むそうです。\nで、これに対してSpacemacsは\n\n.spacemacs\n~/.emacs.d/init.el\n\nの順番で両方を見ているようです(違ってたらごめんなさい)\nただ、色々調べてみたところ、どうもこの2つで役割が微妙に違うらしくて、なのでSpacemacsにSLIMEを導入するにはこの両方を触っていきます。\nまずはSLIME導入\nまず .spacemacs の方にて、(defun dotspacemacs/layers () ... のところで、common-lispを追加します。\n[https://github.com/syl20bnr/spacemacs/tree/master/layers/%2Blang/common-lisp:embed:cite]\nどうやら本来はこれでSLIMEが導入され、処理系としてはデフォルトでSBCLが導入されるらしいのですが、ぼくはこれがうまくいきませんでした。\nで、ということで処理系の設定を(dotspacemacs/user-config () ...のところに(setq inferior-lisp-program \"/path/to/your/lisp\")と書き込みます。\nぼくの場合、HomebrewでインストールしたSBCLのパスは/usr/local/bin/sbclだったので\n(defun dotspacemacs/user-config ()\n  (setq inferior-lisp-program \"/usr/local/bin/sbcl\"))\n\nとしました。\nさて、これでSLIME自体は動きます。\nSpacemacsを立ち上げ直してhoge.lispなりテキトーなファイルを作ってあげて、それでSPC SPCでメタモードにしてslimeと打てばslimeモードを立ち上げられます。\nSLIMEの設定をいじる\n.spacemacsの設定を以上のようにすればSLIMEは動くようになります。\nで、今度はSLIME自体の設定をします。\nまず~/.emacs.d/の中にSLIMEのリポジトリをcloneします。\ncd ~/.emacs.d/\ngit clone git clone https://github.com/slime/slime.git\n\nそうして、~/.emacs.d/init.elに以下のコードを追記します。\n;; ~/.emacs.d/slimeをload-pathに追加\n(add-to-list 'load-path (expand-file-name \"~/.emacs.d/slime\"))\n\n;; SLIMEのロード\n(require 'slime)\n(slime-setup '(slime-repl slime-fancy slime-banner)) \n\nこれでもう一度Spacemacsを立ち上げ直してSLIMEを起動すると、バナーが表示されるのがわかり、実際にちゃんとこの設定を読めていることがわかります。\nちなみに余談なのですが、先ほど~/.emacs.d/init.elに書いた(add-to-list 'load-path (expand-file-name \"~/.emacs.d/slime\"))を書かないと、ターミナルでemacsと売ったらなぜかSpacemacsではなく普通のEmacsが立ち上がるようになります。\nなんででしょう....\nもしかしたら(require 'slime)でSpacemacsではない普通のEmacsが呼ばれるようになっているからかもしれません。\n誰か原因知ってる人がいたら教えてください。\nちなみにここで色々SLIMEの設定をいじることができるので自動補完等もEmacs Lispを書けばなんとかなります。\nRoswell使えないの？\nLispの処理系の導入とかパッケージ管理をひとまとめにしたRoswellですが、残念ながらRoswellとSpacemacsは相性が悪いようで、今回に関しては見送らざるをえないようです。\n色々調べたんですけど、RoswellとSpacemacsはどちらも設定周りがかなりしっかりしてて、お互い相入れないようになってました。\n多分かなり頑張ればいけるんでしょうけど、パッと見では無理そうだったので今回に関してはRoswellは使えません。\nなのでこの後のQuicklispの導入もRoswellを使わずにSBCLに直接Quicklispを設定します。\nQuicklispの導入\nさて、Quicklispを入れるのは比較的簡単で、基本的には公式サイトの通りにします。\n[https://www.quicklisp.org/beta/:embed:cite]\nまずホームディレクトリにQuicklispのインストールのためのソースコードを取ってきます。\ncurl -O https://beta.quicklisp.org/quicklisp.lisp\n\nそうしてSpacemacs内でSLIMEを立ち上げ、その中で\n(load \"~/quicklisp.lisp\")\n(quicklisp-quickstart:install)\n\nこれで入ります。\nさて、これでQuicklispのコマンドを少し叩いてみると\n(ql:system-apropos \"vecto\")\n\nちゃんと動いてることが確認できると思います。\nSpacemacsを立ち上げ直したとき、もしQuicklispが使えないってなったら\n(load \"~/quicklisp.lisp\")\n(quicklisp-quickstart:install)\n\nをやり直して、それでqlってパッケージないよ！と言われたら\n(load \"~/quicklisp/setup.lisp\")\n\nとすればちゃんとQuicklispが使えるようになります。\nまとめ\n以上でSpacemacsへの色々な導入ができました。\nSpacemacsはかなり素敵なエディタだと思うんですけど、やっぱりマイナーなエディタであるのと同時にEmacsに比べると拡張性があまりないので使いづらいところがあるなぁって感じですね。\nやっぱりRoswellと互換性ないのは痛いなぁ....\n","id":"https://komi.dev/slime-in-spacemacs/","title":"SpacemacsでSLIMEを導入してQuicklispを入れる"},"https://komi.dev/start-kai/":{"body":"Softbank AI部 Advent Calendar 2019の7日目。\nまず始めに、今回一緒にアドベントカレンダーを回していってくれている社員の皆さんと内定者に感謝。\nというのも、このSB AI部のアドベントカレンダーの企画を立ち上げたのは自分だからである。\n先日より内定してちょこちょこ社員や内定者と交流するイベントに出たりしているのだけれど、縁あってSB AI部(社員の方で構成されている部活)のSlackに招待してもらった。\nSB AI部については@kmotohasが書かれた2日目の記事に詳細があるので適宜参照。\nちょうど11月の上旬くらい、ツイッターを見てると色々な会社が社内アドベントカレンダーをやっていて(しかも結構楽しそう)、もしかしてソフトバンクもやっているのかな？と思ってSlackをバーっと確認。\nどうも見た感じ特にその手のやりとりは無かったので、randomのチャンネルで質問してみる。\nそうすると、社員の方の何人かが面白そう！とかやってみよ！というような反応をしてくださった。\nこれはイケるやつだ！ということで、勢いでアドベントカレンダーを作成。\n最初は2, 3枠しか埋まらず、入社前から早速やらかしたやつかぁ...と心配していたのだけれど、だんだんと勢いが出てきて、最終的にはビッシリ埋まった。\n本当に社員の皆さんと内定者には感謝である。\nLispと人工知能\nさてさて、前置きはこのくらいにして7日目の記事の本題へ。\nAIもとい人工知能は少し前から話題になっていて、ソフトバンクの注力事業であるわけだけど、この人工知能は最近になってポッと出てきたものではなく昔から長いこと研究されている領域だったりする。\nでは人工知能はいつから研究されているかというと、1950年台に遡り、1956年にAIに関する世界初の国際会議（ダートマス会議）が主催された。\n世界で初めて実用デジタルコンピューターが作られたのが1940年代で、世界で初めての高水準プログラミング言語であるFortranができたのが1954年、これらのことを考えてみればコンピューターの黎明期に人工知能という概念が誕生したと言える。\nちなみに余談として、FortranはFormula Translation(式変形)の略で、昔はマシン言語を直接書いてコンピューターに計算をさせていたのだけど、Fortranはより人間に近い言語をマシン言語に変換する役割(いわゆるコンパイラ)として登場し、「これからの時代はプログラミングをやる必要はない！全てコンピューターが自動でやってくれる！」という強烈な宣伝文句とともに一世風靡し、当時では画期的なものであった。 (出典 : 『プログラマーのジレンマ 夢と現実の狭間』スコット・ローゼンバーグ著)\nさて、そんな時代の中で開催された国際会議で、ジョン・マッカーシーという数学者が世界で初めて「人工知能」という言葉を定義した。\nこのジョン・マッカーシーは人工知能やコンピューターサイエンスにおいて偉大な貢献をした人であり、実は「人工知能の父」と称されるあのマービン・ミンスキーもこの会議を機にAI研究者を志し、その3年後にはMITでマッカーシーを師事することになった。\nさて、この人工知能という言葉を生み出したマッカーシーこそ同時にLispを生んだ人物なのである。(Lisperの間ではマッカーシーはLispを\"発見した\"と言う)\nこの初めてLispを提案したのがこの論文。\nマッカーシーの数多くの貢献の中でも特に有名なものとして、現在ほとんどのプログラミング言語で実装されているif文やガベージコレクションなどがある。(実はかつてのFortranにはif文がなくgoto文しかなかった)\nif文もガベージコレクションも、高水準プログラミング言語として初めて実装されたのはLispなのである。\nこれ以外に、マッカーシーはタイムシェアリングシステムというものも提案しており、これは何かというと現在でのアプリケーションサービスプロバイダ、つまりSaaSで、現在流行っているビジネスモデルを半世紀以上前にマッカーシーは実現可能だと提案していた。\n...とまあマッカーシーがすごいという話はある程度にしておいて、人工知能の歴史やLispがどのような興隆を経てきたかという話については以下の記事が非常によくまとまっているのでぜひ読んでもらいたい。\n人工知能は2回の冬の時代を経て現代でまた興隆を極めているのだけれど、現代の人工知能技術の中核をなす技術であるディープラーニングは膨大な数値計算によって成立している。\nかつての人工知能は記号推論によって解決しようとしていたのだが、現実世界でも適用可能な妥当なルールベースを作りこむことが難しいことが分かってきたので、その後は大量のデータからボトムアップ的に学習して自動的に知識表現を獲得してやろうという流れになり、ニューラルネットなどの機械学習手法が発達した。\nなので大きな枠組みで見れば現在のディープラーニングも知識をどのように計算機で実現するかという話であり、それを抽象的なレイヤで行うかボトムアップ的に行うかでアプローチが異なるだけだったりして、本質的には変わらなかったりする。\nもうPython卒業しようよ\nコンピュータの性能向上に伴い、プログラミング言語にはアルゴリズムの表現力と開発効率が要求されてくるようになった。\nそれにより、今はPythonが最も注目される言語となった。\nただPython単体だとスクリプト型言語のために実行速度が非常に遅く、ディーブラーニングのような膨大な量のパラメータを逐次更新していくようなアルゴリズムに対しては実行が遅すぎるので、ライブラリとして一部の処理をC言語のような高速な言語に実行させることによってアルゴリズムの表現力を保持しつつ実行速度の担保をするような手法が取られるようになってきているのが昨今の流れとなっている。\nここでのライブラリというのがTensorFlowだったりPytorch、Keras、今は亡きTheanoやCaffeなどである。\nパッと見だとこれらのアプローチは良さげだと思われるが、例えばエッジコンピューティングのような組み込みなどのものだとPythonを主軸にしたやり方ではメモリを圧迫しすぎてしまうのでプログラムを乗せることができず、結局アルゴリズムの実装しやすさと開発効率を重視したのに最終的にC言語で実装し直すという本末転倒的なことになる。\n一応PythonをネイティブコードへコンパイルするCythonというものもあったりするが、結局Python本来が持つアルゴリズムの実装しやすさに制限をかけることになり、結局何がしたかったんだろうという感じになってしまう。\nこのような考えのもと、機械学習アルゴリズムの社会実装への需要が高まっている昨今でいつまでもディープラーニングのアルゴリズムの実装はPythonで実装するしかないというのは少々前時代的という考え方にすら至りうる。\n現在ではプログラミング言語も様々な開発が進んでおり、個人的にはJuliaという言語に注目していて、Python以上に柔軟な文法を持ちながら高速である(少なくともPythonの10倍くらい)\nこのような背景も考えるとPythonに頼り続けるのは限界があると思うし、次の時代を見据えるならPython以外の言語に視野を広げる必要があると思う。\nLispという一つのアプローチ\nさて、ここで一つの解決法として自分はLispはアリなのではないかと考えている。\nLispはもともと超絶柔軟な文法を持っており(もはや文法が存在しないと言っていい)、強力な抽象化機構を持っているのでアルゴリズムの表現性という点ではあらゆる言語の中で強力なものである。\n柔軟な文法とはどういうことかというと、Lispは自分で構文を定義することができるのである。\n例えば、Pythonでは関数を定義する際に\ndef hoge(x, y):\n    return x + y\n\nのように関数を定義することはできるが、このPython本体がもともと持っている関数定義defを自分で定義することはできず、my-defやmy-ifのようなオリジナルの構文を作ることはできない。\nLispはマクロという機能を使うことによって自身の構文を定義することができ、言ってしまえばその場で自分オリジナルのプログラミング言語を作ることができる。\n具体的に、Lispのマクロを使えばSQLやHTMLなどもLispのコードとして実装することができる。\nどの言語を使うかで何を言えるかが変わってくる。\nLispは主に関数型プログラミングのパラダイムを採用していて、高階関数やラムダ式をサポートしているため、Lisp本来が持つ柔軟さもあって一つにアルゴリズムを実装するにしてもC言語とLispではコードの量が10倍以上違ってくる。\nこのようなLispではあるが、速度はどうかというと、C言語並みか場合によってはCより速くなる。\n今はLispはあまり有名な言語ではないが、かつてはコンパイラの研究でLispが先頭を走っており、Lispマシンというものも存在したほどであり、昔から高速なプログラミング言語の部類にある。\n中には強烈な名言もあり\n\nCで書くコードの方がCommon Lispで書くより速いって人がいたら、それは彼のCの技量が高すぎるってことだね。\n“If you can't outperform C in CL, you're too good at C.” — Eric Naggum\n\nLispが高速な言語であることを物語っている。\nこのCより高速なLispのコードを書くことについては以下の深町さんの記事が非常に面白いので参照。\nLispの高速さを物語るプロダクトとして、この深町さんが実装したWooというHTTPサーバーはあらゆるHTTPサーバーの中でも最高クラスの速度を誇っている。\nLispがこのような高速さを担保している理由として、OSSでSBCLというネイティブコードまでコンパイルする超優秀なコンパイラがあり、これに最適化オプションをつけることによって超高速なコードを書くことができる。(自分はSBCLのコミッター)\n最適化に際して、Lispの処理系にはプロファイラという機能がついており、プログラムのどの部分が時間がかかっているかを調べることができるのでボトルネックの発見に役立つ。\nそうしてこの時間がかかっているブロックに対して細かく最適化オプションをつけることができ、他のプログラミング言語に比しても最適化を軽快に行うことができる。\nこの最適化については前に記事を書いた。\nこのようにLispは速度も高速で柔軟性を持っている言語だが、もう一つ絶対に語っておかなければいけないのがSLIMEという開発支援ツールである。\nLispの特徴として括弧がたくさん現れるが、Lispでは括弧の塊それぞれが一つのソースコードとなっている。\nこれの何がすごいかというと、ソースコードの一部だけをコンパイルして実行することができる。\n[f:id:komi1230:20191207003351p:plain]\nこの機能があると、手元で書いたソースコードを即時コンパイルしてその場でテストすることができ、実装からテストまでのサイクルを高速で回せるようになるのである。\n以上、Lispは高速で柔軟な文法を持ち強力な開発支援ツールを持ったすごい言語だと言える。\nなぜLispは人気がないのか\nこのようなプログラミング言語として強力過ぎる魅力を持った言語であるのに、なぜLispはユーザーが少なく人気がないのか。\nこれに関してはさっぱりわからない。\n自分はLispを書き始めて数年経つが、特に文句はないし、むしろC言語やPython、JavaScriptなどの他の言語を触るたびに「なぜLispのような機能がないのか」「なぜLispより圧倒的に遅いのか」とイライラさえする。\nもっとLispは評価されるべきだしLisp界隈が盛り上がっていくべきだと思っている。\nただ一点、指摘することがあるとすれば、ライブラリの開発が全体として勢いがないというのはある。\nこれはLispユーザーが少ないことによる副次的な影響なのだが、ライブラリの開発があまり活発に行われていないために死んでしまっているようなライブラリも数少なく、ソースコード自体はバリバリ現役でもドキュメントが古すぎて存在しない(もしくは埋もれてしまっている)ということがある。\nLispのこれからのために\nそのようなLispであるが、個人的には最近どんどん勢いが上がっている気がする。\n先述の深町さんがCommon LispでWeb系ライブラリを作りまくってLisp × Webの雪原を踏み荒らしまくった結果、Lispユーザーがグッと増えたような気がする。\nそれを見て、自分は自分も得意分野を盛り上げて行こうと思うようになった。\n先日もIBMでAIリサーチャーをやっているMasataro AraiさんからNumclというライブラリを一緒に開発していかないかとお誘いいただいた。\nこれはPythonのNumpyにある機能をCommon Lispライクに実装しようというプロジェクトで、自分は機械学習系・数値計算系の人間なので、このようなプロジェクトは非常にワクワクしている。\nさて、数値計算や機械学習系のプロダクトを開発するにあたって、何かとデータを可視化させるツールというのは必要になる。\n一応Common LispにはCL-Plotのような可視化ツールは存在するが、だいたいが2次元プロットで、3次元プロットや散布図、ヒストグラム、ヒートマップのような機能はない。\nということでMatplotlibのようなプロッターをOSSとして自分で作ることにした。\n名前はKaiとし、ハワイ語で海という意味を持つ。\n現在まだ開発途中であるが、すでに2次元プロット程度ならできるようになっている。\nまだ依存関係を記述するファイルなどを整えていないのでプロダクトとしてしっかりリリースはできていないが、ライブラリとしての体裁が整ったらまた追って正式にリリースの報告を出そうと思っている。\n自分はLispを愛しているが、これからどんどん盛り上がっていけるように自分にできるコミットをどんどんやっていこうと思う。\nこれからLispの時代が来るように、一つ一つできることを積み上げていこうと思う。\n終わりに\nSoftbank AI部のアドベントカレンダーの記事だったが、結果的にただのLispの宣伝になってしまった感がある。\nただ、本当に自分はこれからのAI系プロダクトではLispは一つのアプローチになると信じているので、これからもコミットしていこうと思う。\nそれではお疲れ様でした。\n興味を持った人に読んでほしいもの\n\nいまから始めるCommon Lisp\n\nLispをちょっと始めてみようかなという人向けの記事。\n\nLand of Lisp\n\nCommon Lispの勉強で、入門として非常に良い本。\n\nハッカーと画家\n\nY Combinatorの設立者でありLisp界のゴッドファーザーのポール・グレアムのエッセイ。\nAmazonのリンク\n","id":"https://komi.dev/start-kai/","title":"\t自作OSSとしてCommon Lisp用の描画ツールKaiを作っています"},"https://komi.dev/unix-command-from-common-lisp/":{"body":"やや久しぶりの更新。\n最近はあまりLispを書いてなくて、ずっとベイズ深層学習の勉強をしている。\n先日なんとなく書店をフラフラしていたところコンピュータサイエンス系の棚にて須山さんの『ベイズ深層学習』を発見し、勢いで購入したのだけれどこれがなかなか面白い。\nいわゆる頻度論的なアプローチとベイズ的なアプローチをうまく対比させていて、どう異なっていてどう共通部分を見出せるかについてかなり簡潔に説明されており、ベイズについては1年前にPRMLを読んだだけだったので久しぶりにしっかり手を動かして読み進めている。\nそういえばCommon Lispでベイズ系のライブラリは無かった気がするので実装しようかなという構想がある。\nベイズ推論は尤度関数などをしっかり計算しようとするとなかなか計算量がハードで、ベイズ推論パッケージであるStanは記述されたモデルを一度C++にトランスレートして計算しているので、C並みの速度が出るCommon Lispならマクロなどを活用することでCommon Lispネイティブで実装ができると踏んでいる。\nCommon Lispでやりたいことはたくさんあるのだけれど、時間が空き次第しっかり開発に着手しようと思う。\nさて、本題へ。\nソースコードからUnixコマンド\nPythonなどでUnixコマンドを叩こうとする際は subprocess を使うことでなんとかできる。\n\nimport subprocess as sp\n\nsp.call(\"pwd\")\n# =&gt; \"/path/to/your/current/directory\"\n\n引数ありのUnixコマンドを叩く際は、引数にリストとして入れてあげればできる。\nimport subprocess as sp\n\nsp.call([\"ls\", \"Desktop\"])\n\nこのようにソースコードからUnixコマンドを叩くことができると色々なツールのラッパーを簡単に作成することができる。(例えばGnuplotとか)\nさて、こうしたUnixコマンドをソースコードから叩くのをCommon Lispでやるのはややめんどくさい。\nというのも処理系依存だからである。\n例えば自分が普段から使っているSBCLは sb-ext:run-program で、\n(sb-ext:run-program \"/bin/ls\" '(\"Desktop\") :output t) \n\nという具合になる。\nしかしこれはSBCLの場合で、CLISPやCCLとなるとまた変わってくる。\nちなみにSBCLではこの sb-ext:run-program によって解決できるが、SLIMEでこれを使おうとするとまた別の問題が起こり、標準出力ができずに失敗するのでstreamとして渡してあげる必要がある。\nまあ要するに汎用的なコードを書くには問題だらけなのである。\ntrivial-shellという選択\nさて、Common Lispには trivial-shell というライブラリがある。\nこれは上記の問題を解決するために用意されたもので、簡単に使える。\n例えば\n(ql:quickload :trivial-shell)\n\n(defun system (cmd-str)\n (trivial-shell:shell-command cmd-str))\n\nとすれば (system \"ls\") のようにして使え、Pythonの subprocess とほぼ同様のインターフェースが実現できる。\nこの trivial-shell は上記のSLIMEでの問題も解決している。\nだいたいはこれで問題なさそう。\nただ一つ文句をつけるとすれば、ls での結果表示が #\\Newline によって改行されており、結果をリストとして表示するにはちょっと一手間を加える必要がある。\n自分は上記の画像の通り、以下のようなやり方で解決している。\n(ql:quickload :trivial-shell)\n\n(defun system (cmd-str)\n (trivial-shell:shell-command cmd-str))\n\n;; split関数を用意\n(defun split (x str)\n  (let ((pos (search x str))\n        (size (length x)))\n    (if pos\n      (cons (subseq str 0 pos)\n            (split x (subseq str (+ pos size))))\n      (list str))))\n\n;; split関数によって改行でリストごとに切っていく\n(split (string #\\Newline) (system \"ls\"))\n\nこれで良さげ。\n終わりに\n自分は今のところCommon LispでUnixコマンドが欲しくなることはあまり無かったのだけど(せいぜいカレントディレクトリを見るくらいで sb-posix:getcwd で解決する)、今日後輩からその手の質問をされて気になったので自分で今回調べてみた。\n自分はCommon Lispではアルゴリズムについてよく考える一方でシステムについてあまり触らないので、たまにはこういうのも面白いかもなと思ったり。\n勉強になった。\n","id":"https://komi.dev/unix-command-from-common-lisp/","title":"\tCommon LispのソースコードからUnixコマンドを叩く"},"https://komi.dev/zsh-subcommand-alias/":{"body":"REPLを触っているとき過去の入力を遡ったり矢印キーを使って云々するってことはよくあること。\nこれがあると結構色々便利だったりする。\nさて、Common Lispの処理系でREPLを起動するときあまりこれができないのでhogeという気持ちになってしまう。\n普段使っているのはRoswellというもので、REPLを起動する際は\n$ ros run\n\nとする。\n今回はこのros runに対してrlwrapを効かせたい。\nエイリアスをあてる\nzshの環境でエイリアスをあてるとき\nalias '[target-command]=[original-commands]'\n\nという書き方をするが、このtarget-commandにサブコマンド入りを入れることはできない。\n具体的に\n# これは動かない\nalias 'pip install=pip install --user'\n\nは機能しない。\nということでzshrcにて関数を定義してやる。\nfunction ros() {\n    if [[ \"$1\" == \"run\" ]]; then\n        shift 1\n        command rlwrap ros run \"$@\"\n    else\n        command ros \"$@\"\n    fi\n}      \n\nこれをしてやることによって、例えばros install hogehogeとすると普通のrosコマンドが機能し、第一引数にrunがある場合はrlwrap ros runが機能するよう条件分岐してくれる。\n先ほどのpip installの例では\nfunction pip() {\n  if [[ \"$1\" == \"install\" ]]; then\n    shift 1\n    command pip install --user \"$@\"\n  else\n    command pip \"$@\"\n  fi\n}\n\nとなる。\n","id":"https://komi.dev/zsh-subcommand-alias/","title":"Zshでサブコマンドにエイリアスをあてる"}},"docInfo":{"https://komi.dev/":{"body":0,"title":0},"https://komi.dev/about/":{"body":59,"title":0},"https://komi.dev/api-server-with-actix-web/":{"body":94,"title":2},"https://komi.dev/clojure-macro/":{"body":434,"title":1},"https://komi.dev/clojure-mini-server/":{"body":145,"title":1},"https://komi.dev/diesel-postgres/":{"body":104,"title":1},"https://komi.dev/hello-world/":{"body":3,"title":3},"https://komi.dev/json-post-to-actix-web/":{"body":147,"title":2},"https://komi.dev/opengl-from-slime/":{"body":231,"title":1},"https://komi.dev/pages/":{"body":0,"title":0},"https://komi.dev/return-scholarship/":{"body":43,"title":1},"https://komi.dev/rust-in-emacs/":{"body":48,"title":1},"https://komi.dev/slime-in-spacemacs/":{"body":125,"title":1},"https://komi.dev/start-kai/":{"body":112,"title":2},"https://komi.dev/unix-command-from-common-lisp/":{"body":121,"title":2},"https://komi.dev/zsh-subcommand-alias/":{"body":54,"title":1}},"length":16},"lang":"English"};